import { createSlice } from '@reduxjs/toolkit'


const initialState = {
    user: false
}

const auth = createSlice({
    name: 'auth',
    initialState,
    reducers: {
        setUser: (state, action) => {
        }
    }
})

export const { setUser } = auth.actions
export default auth.reducer
